import React from 'react';
import Card from './Card'; // Import the Card component

const User = (props) => {
  return (
    <Card className="users">
      <img src={props.img} alt={props.name} />
      <h2>{props.name}</h2>
      <p>Age: {props.age}</p>
      <p>Major: {props.major}</p>
    </Card>
  );
};

export default User;
